import styles from './Products.module.css';

function Products() {

    return(
        <div className={styles.header}>
            <div className={styles.headerLeft}>
                <p>About</p>
                <p>Search</p>
            </div>
            <p className={styles.headerCenter}>DogSeek</p>
            <div className={styles.headerRight}>
                <p>My Page</p>
                <p>Logout</p>
            </div>
        </div>
    )
}

export default Products;
